import React from "react";
import { Link } from "react-router-dom";
import home from"../src/Images/home.gif"


const CommonComp = (props) => {
  return (
    <>
      <section id="header" className="d-flex">
        <div className="contianer-fluid nav_bg">
          <div className="row">
            <div className="col-10 mx-auto ">
                <div className="row">
                <div className="col-md-6 mt-5 pt-5 pt-lg-0 order-2 order-lg-1 d-flex justify-content-centre flex-column">
                    <h1>{props.name} <strong className="brand-name">Abhishek Verma</strong></h1>
                    <h4 className="my-3">
                        {props.name}
                    </h4>
                    <div className="mt-3">
                        <Link to={props.visit} className="btn btn-primary"> {}</Link>
                    </div>
                </div>

                <div className="col-lg-6 order-1 order-lg-2 header-img">
                    <img src={props.imgsrc} className="img-fluid animated" alt="hmimg" />
                </div>
                </div>
            </div>
          </div>
        </div>
      </section>
    </>
  );
};

export default CommonComp;
